				<div class="light white"></div>
				<div class="light red"></div>
				<div class="light green"></div>
				</div> -->




<div class="slot">
		<img id="title" src="./assets/img/title.png">
		<img id="hero" src="./assets/img/hero.png">
		<h2 id="statusMessage">Deposit credits to start play!</h2>
		<p id="rcorners1"></p>
	<!-- <h1>Marvel!</h1> -->
	<div class="slotImages">
		<img id="img1" src="./assets/img/credits.svg"> 
		<img id="img2" src="./assets/img/credits.svg">
		 <img id="img3" src="./assets/img/credits.svg"></div>


	<main class="deck">
			<section class="flex">
				<select id="deposit">
					<option id="resetDeposit" value="0">
						Deposit Credits
					</option>
					<option value="5">
						5
					</option>
					<option value="10">
						10
					</option>
					<option value="20">
						20
					</option>
				</select>
			
			</section>
		
			<div id="depositfive" class="dpz" onclick='depof()'>Deposit Five</div>
			<div id="depositten" class="dpz" onclick='depot()'>Deposit Ten</div>
			<div id="depositten" class="dpz" onclick='depotw()'>Deposit Twenty</div>

		
			<section class="flex">
					<input class="credits" id="credit" type="text" value="0">
					<p>credits</p>
				<div class="bets">
					<input id="betOne" name="bet" type="radio" value="1"><label class="button" for="betOne">Bet<br>
					One</label> <input id="betTwo" name="bet" type="radio" value="2"><label class="button" for="betTwo">Bet<br>
					Two</label> <input id="betThree" name="bet" type="radio" value="3"><label class="button" for="betThree">Bet<br>
					Max</label>
				</div>
				<input class="cashOut" id="cashOut" type="button" value="Cash Out">
				<input class="play" id="play" type="hidden" value="Spin">
			</section>
		</main>

</div>
